import React from 'react';
// Header 컴포넌트 정의
function HeaderButton({name}) {

  return (
    <button
      style={headerButtonStyle}
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >{name}</button>
  );
}

export default HeaderButton;
